import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { environment } from 'src/environments/environment';
import { ModelOwner } from '../models/owner-model';

@Injectable({
  providedIn: 'root'
})
export class OwnerService {

  basePath: string = environment._APIUrl + '/owner';

  constructor(private readonly http: HttpClient) {}

  getPhotoDefault() {
    return 'data:image/jpg;base64,';
  }

  getOwnerFilter(filter: any) {
    const headers = { 'content-type': 'application/json' };
    const body = JSON.stringify(filter);
    return this.http.post<any>(`${this.basePath}/filter`, body, {
      headers: headers,
    });
  }

  createOwner(owner: ModelOwner) {
    const headers = { 'content-type': 'application/json' };
    const body = JSON.stringify(owner);
    return this.http.post<any>(`${this.basePath}/save`, body, {
      headers: headers,
    });
  }
}
